ont color="#333333" size="-1">個装サイズ：17×6×21cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約147g(本体のみ)</font><br><font color="#333333" size="-1">個装重量：450g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">電源:充電交流式(AC100-240V・50/60Hz)<br>消費電力:6W<br>電源コードの長さ:1.8m<br>充電時間:8時間<br>使用可能時間:約40分<br>刃種類:鋭角刃でクリーンカット<br>本体水洗い可<br>防水設計:IPX7基準<br><br>【刈高さ(1mm単位調節)】<br>ショートアタッチメント:3～36mm<br>ロングアタッチメント:37～70mm<br>アタッチメントなし:1mm</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">ショートアタッチメント、ロングアタッチメント、スキ刈アタッチメント、オイル、 掃除用ブラシ、電源アダプター、ヘアーアレンジシート、取扱説明書、保証書(保証期間:1年)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">中国</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
